export default[,
{
    path:'/',
    component: () => import('@/pages/regester'),    
    children:[
        {
          path:'login',
          component: () => import('@/components/login/enrollcenter'),
        },
    {
        path:'/tosell',
        component: () => import('@/components/login/enrollcenter'),   
    }]   
}
]
